import React from 'react';
import { Container, Row, Col, Form, Button, Card, Table } from 'react-bootstrap';

class AllLights extends React.Component {

    render() {
        return (
            <Card auto>
              <Card.Body>
                <Card.Title>All Lights</Card.Title>

                <Form>
                  <div className="on-off-buttons d-grid gap-2">
                    <Button variant="primary" size="lg">On</Button>
                    <Button variant="secondary" size="lg">Off</Button>
                  </div>

                  <Form.Label>Range</Form.Label>
                  <Form.Range />
                </Form>
              </Card.Body>
            </Card>
        );
    }
}

export default AllLights;
